import React, { Component } from 'react'

class Check extends Component {
    constructor(props) {
        super(props)

        this.state = {
             checked: true
        }
    }

    render() {
        return (
            <div>
                <input type='checkbox'></input>
            </div>
        )
    }
}

export default Check;
